function formatDMYHHMM_To_Date(n){try{if(n!=undefined&&n!=""){dates=n.split(" ");dates1=dates[0]?.split("-");dates2=dates[1]?.split(":");let t=dates1[2]??0,i=dates1[1]??0,r=dates1[0]??0,u=dates2[0]??0,f=dates2[1]??0,e=dates2[2]??0;return new Date(t,i-1,r,u,f,e,0)}return new Date}catch(t){return new Date}}function ConvertDMY_ToInt(n){try{return n=n.split("-"),Number(n[2]+n[1]+n[0])}catch(t){return 0}}function formatDateClient(n){if(n!=undefined&&n!=""){var r=new Date(n),t=""+(r.getMonth()+1),i=""+r.getDate(),u=r.getFullYear();return t.length<2&&(t="0"+t),i.length<2&&(i="0"+i),[i,t,u].join("-")}return"01-01-1900"}function ConvertDateTime_To_Timespan_TimeZone(n){try{return n.getTime()+n.getTimezoneOffset()*-6e4}catch(t){return 0}}function ConvertString_DMY_To_StringYMD(n){try{let t=n.split(" ")[0];return t.split("-")[2]+"-"+t.split("-")[1]+"-"+t.split("-")[0]}catch(t){return""}}function ConvertString_DMYHM_To_DateTime(n){try{let t=n.split(" ")[0],i=n.split(" ")[1];return new Date(t.split("-")[2],Number(t.split("-")[1])-1,t.split("-")[0],i.split(":")[0],i.split(":")[1])}catch(t){return""}}function GetDateTime_String_DMYHMSS(n){try{var t=new Date(n);let i=t.getMonth()+1,r=i<10?"0"+i:i,u=t.getDate()<10?"0"+t.getDate():t.getDate(),f=t.getHours()<10?"0"+t.getHours():t.getHours(),e=t.getMinutes()<10?"0"+t.getMinutes():t.getMinutes(),o=t.getSeconds()<10?"0"+t.getSeconds():t.getSeconds();return u+"-"+r+"-"+t.getFullYear()+" "+f+":"+e+":"+o}catch(i){return""}}function GetDateTime_String_DMYHM(n){try{var t=new Date(n);let i=t.getMonth()+1,r=i<10?"0"+i:i,u=t.getDate()<10?"0"+t.getDate():t.getDate(),f=t.getHours()<10?"0"+t.getHours():t.getHours(),e=t.getMinutes()<10?"0"+t.getMinutes():t.getMinutes();return u+"-"+r+"-"+t.getFullYear()+" "+f+":"+e}catch(i){return""}}function GetDateTime_String_DMY(n){try{var t=new Date(n);let i=t.getMonth()+1,r=i<10?"0"+i:i,u=t.getDate()<10?"0"+t.getDate():t.getDate();return u+"-"+r+"-"+t.getFullYear()}catch(i){return""}}function ConvertToDateRemove1900(n){try{var t=new Date(n);return Number(t.getFullYear())==1900?"":n}catch(i){return n}}function ConvertString_DMY_To_DateTime(n){try{let t=n.split(" ")[0];return new Date(t.split("-")[2],Number(t.split("-")[1])-1,t.split("-")[0])}catch(t){return""}}function ConvertDT_To_StringYMD(n){try{var t=new Date(n);let i=t.getMonth()+1,r=i<10?"0"+i:i,u=t.getDate()<10?"0"+t.getDate():t.getDate();return t.getFullYear()+"-"+r+"-"+u}catch(i){return""}}